import "../components/PlantCard.css"
import "../styles.css"

function PlantCard() {
  return (
    <div className='card-box'>
    <div className='card-background'>
      <img style={{
        height: "100px",
        width: "100px",}}>
      </img>
    </div>
    </div>
  )
}

export default PlantCard
